def TurnDial(startPos, direction, distance):
    if direction == "L":
        return (startPos - distance) % 100
    else:
        return (startPos + distance) % 100

def GetRotations(document):
    rotations = []
    index = -1

    for char in document:
        if char == "L" or char == "R":
            rotations.append([char, ""])
            index += 1
        else:
            rotations[index][1] = rotations[index][1] + char

    return rotations

def GetPassword1(rotations):
    count = 0
    start = 50

    for rotation in rotations:
        start = TurnDial(start, rotation[0], int(rotation[1]))
        if start == 0:
            count += 1

    return count

def CountRotations(startPos, direction, distance):
    if direction == "L":
        if distance < startPos:
            return 0
        else:
            distance -= startPos
    else:
        if distance < (100 - startPos):
            return 0
        else:
            distance -= (100 - startPos)

    return distance // 100 + 1

def GetPassword2(rotations):
    count = 0
    start = 50

    for rotation in rotations:
        count += CountRotations(start, rotation[0], int(rotation[1]))
        start = TurnDial(start, rotation[0], int(rotation[1]))

    return count

# Main

rotations = GetRotations(ExampleDocument)
print(GetPassword2(rotations))